          href="https://www.facebook.com/houseoflightgrilbars/"
          target="_blank"
          className="facebook_link"
          rel="noopener noreferrer"
        >
          Facebook
        </a>
        , gan{" "}
        <a
          href="https://www.instagram.com/houseoflightgrilbars/"
          target="_blank"
          rel="noopener noreferrer"
        >
          {" "}
          Instagram
        </a>{" "}
        lapās.
      </div>
    </div>
  );
};

export default Brunch;
